import React from 'react';

function Visual() {
	const path = process.env.PUBLIC_URL;
	return (
		<figure id='visual'>
			<div className='pic'>
				<img src={`${path}/img/main_visual.jpg`} alt='커피를 따르는 모습' />
			</div>
		</figure>
	);
}

export default Visual;
